class JobModel{constructor(){this.hashId="";this.name="";this.hostId=0;this.schedule="";this.type=0;this.localPath="";this.remotePath="";this.isNameValid=!0;this.isHostValid=!0;this.isScheduleValid=!1;this.isTypeValid=!0;this.isLocalPathValid=!0;this.isRemotePathValid=!0}convertScheduleToWords=function(n,t){var r=this;var i="";axios.get("/api/cron",{params:{schedule:n}}).then(n=>{r.isScheduleValid=n.data.isValid;if(r.isScheduleValid){i=n.data.scheduleInWords}else{i=n.data.errorMessage}}).catch(n=>{r.isScheduleValid=false;i="An error occurred retrieving the cron description - check application logs for details"}).then(()=>{t(i)})};validate=function(){this.validateName();this.validateHost();this.validateType();this.validateLocalPath();this.validateRemotePath();return(this.isNameValid&&this.isHostValid&&this.isScheduleValid&&this.isTypeValid&&this.isLocalPathValid&&this.isRemotePathValid)};validateHost=function(){this.isHostValid=(this.hostId>0);return this.isHostValid};validateName=function(){this.isNameValid=(this.name.length>=3);return this.isNameValid};validateType=function(){this.isTypeValid=(this.type>=1&&this.type<=2);return this.isTypeValid};validateLocalPath=function(){this.isLocalPathValid=(this.localPath.length>0);return this.isLocalPathValid};validateRemotePath=function(){this.isRemotePathValid=(this.remotePath.length>0);return this.isRemotePathValid};}